import 'package:freezed_annotation/freezed_annotation.dart';part 'EmployeeDetailResponse.freezed.dart';part 'EmployeeDetailResponse.g.dart';@Freezed()class EmployeeDetailResponse with _$EmployeeDetailResponse {  const factory EmployeeDetailResponse({    bool? status,    String? remarks,    @JsonKey(name: 'EmployeeDetails') EmployeeDetails? employeeDetails,  }) = _EmployeeDetailResponse;  factory EmployeeDetailResponse.fromJson(Map<String, dynamic> json) =>      _$EmployeeDetailResponseFromJson(json);}@Freezed()class EmployeeDetails with _$EmployeeDetails {  const factory EmployeeDetails(      {@JsonKey(name: 'employeename') String? employeeName,      String? otp,      @JsonKey(name: 'mobileno') String? mobileNumber,      @JsonKey(name: 'designation') String? designation,      @JsonKey(name: 'loginid') String? loginId,      String? mpin}) = _EmployeeDetails;  factory EmployeeDetails.fromJson(Map<String, dynamic> json) =>      _$EmployeeDetailsFromJson(json);}